import { NavLink } from "react-bootstrap";
const Index = (props) => {
  const Link = () => {
    <>
      <NavLink
        to={props.TitleLink}
        className="profil_emp_inter_page_title finance_inter_page_title"
      >
        {props.TilelIcon}
        {props.Name}
      </NavLink>
    </>;
  };
  const Text = () => {
    <>
      <span>
        {props.TilelIcon}
        {props.Name}
      </span>
    </>;
  };
  return <>{TitleLink ? <Link /> : <Text />}</>;
};
export default Index;
